tner who does and believes in the same! (Quality time is one of my love languages!)\x26#xa;\x26#xa;Family: I have a small family whom I am very close to (we speak on the phone daily). I also have a number of friends I consider chosen-family. I am a god-mama to two beautiful girls - 6 years \x26amp; 2 years - the children of my best childhood friend of 20 years’. I absolutely adore them!\x26#xa;\x26#xa;Books I love: I love reading. I tend towards non-fiction (nerd about nature, biology, science, sociology \x26amp; psychology), but enjoy fiction or fantasy too (yay HP\/LOTR!). Some of my favorite books: Braiding Sweetgrass, Dharma Bums, When Things Fall Apart, The Third Plate, The Untethered Soul, 13 Moons, Grit.\x26#xa;\x26#xa;Music I love: I’m a music nerd more likely to be listening to music than watching TV.  Daily at-home dance parties are a must. \x26#x1f973; I enjoy a huge spectrum of music. A few artists I love; Maleek Berry, The Avett Brothers, Rexx Life Raj, Mac Miller, Felix Rösch, Nils Frahm, Amelia Moore, June Freedom, Skrillex, Sza, 6lack \x26amp; Raaginder…\x26#xa;\x26#xa;Hobbies: Surfing, recently re-ignited my passion for hiking, camping \x26amp; backpacking, reading, singing, traveling. I hope to take classes on ceramics and foraging soon!\x26#xa;\x22 tabindex\x3d\x220\x22\x3e\x3cpath fill\x3d\x22#000000\x22 fill-opacity\x3d\x220.0\x22 d\x3d\x22m289.18634 16.136482l0 338.14175l620.3465 0l0 -338.14175z\x22 fill-rule\x3d\x22nonzero\x22\/\x3e\x3c\/g\x3e\x3cpath fill\x3d\x22#000000\x22 fill-opacity\x3d\x220.0\x22 d\x3d\x22m289.18634 16.136482l620.3465 0l0 338.14175l-620.3465 0z\x22 fill-rule\x3d\x22evenodd\x22\/\x3e\x3cpath fill\x3d\x22#4d4542\x22 d\x3d\x22m308.5301 40.496483l0 -7.46875l-3.015625 7.46875l-0.984375 0l-3.015625 -7.46875l0 7.46875l-2.265625 0l0 -10.671875l3.171875 0l2.59375 6.453125l2.59375 -6.453125l3.203125 0l0 10.671875l-2.28125 0zm4.383148 1.203125q0.25 0.125 0.640625 0.125q0.8125 0 1.0625 -0.5625l0.296875 -0.65625l-3.140625 -7.84375l2.
